import React, { useState } from "react";
import "./index.css";

const InputField = ({ subject, cname }) => {
  const [isValid, setIsValid] = useState(true);

  return (
    <div className={cname}>
      <div className="field">
        <label for={subject}>{subject}</label>
        <br />
        <input id={subject} className={isValid ? "valid" : "invalid"}></input>
      </div>
    </div>
  );
};

export default InputField;
